import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      dbcheck: [],
      test: []
    }
  }
  render() {
    return (
      <div className="App">
        <h1>ログイン</h1>
        <a href="/auth">
          LINE ログインテスト2
    </a><br></br>
        <button onClick={this.lineAuth}>ログイン</button>

        <p>
          <h2>tester</h2>
          ------------------<br></br>
          <a href="/callback">
            callback
        </a>
          <br></br>
          <a href="/db" >
            DBChecker
        </a>
          {this.state.dbcheck.map(data =>
            <div>
              {data}
            </div>
          )}

          <br></br>
          <button onClick={this.getDBChecker}>
            DBChecker in local
        </button>
          <br></br>
          <a href="/Homelocal">
            HomeChecker in local
        </a>
          <form method="post" action="/Home">
            formtester<br></br>
          </form>
          -------------------------
    </p>
        <button onClick={this.getTest}>tester</button>
        {this.state.test.map(data =>
          <div>
            {data.name}
          </div>)}
      </div>
    );
  }

  getDBChecker = () => {
    console.log("dbcheck")
    fetch('/dblocal')
      .then(res => res.json())
      .then(data => { this.setState({ dbcheck: data }); console.log(data) })
  }
  lineAuth = () => {
    fetch('/auth')
      .then(res => res.json())
  }
  getTest = () => {
    console.log("test");
    fetch('/test')
      .then(res => res.json())
      .then(data => this.setState({ test: data }))
  }
}

export default App;
